INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 1, 0, 0.0, 1, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24001, 0.0, "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 1, 1, 0.0, 1, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24002, 0.0, "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 1, 2, 0.0, 1, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24003, 0.0, "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 2, 3, 0.0, 2, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24004, 0.0, "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 1, 4, 0.0, 1, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24005, 0.0, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
