INSERT INTO `v1_d02f4f41bf206a6439e59da39d811d5d93484c67d3254cf9fa4555f1ca3ed752` VALUES ("2020/04/30 12:00:00", 1, 12, 1.81, 4, 24, "リン", 10040, 0.0, "2030/12/17 14:59:59", 102601, 24013, 0.0, "疲れた…\nけど、次こそは\n守り抜くよ…");
